import "./App.css";
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";
//Other Pages
import LogIn from "./LogIn.js";
import SignUpLogIn from "./components/signup/signup.jsx";
import SecondPage from './secondPage/secondPage';

function App() {
  return (
    <Router>
      <div>
        <Link to="/">
          <h1>Home</h1>
        </Link>
        <Link to="./secondPage/secondPage">
          <h1>Page2</h1>
        </Link>
        <Link to="./components/signup/signup">
          <h1>Sign Up</h1>
        </Link>
        <Switch>
          <Route path='./secondPage/secondPage.js'>
            <SecondPage />
            </Route>
          {/* <Route Path="./components/signup/signup.jsx">
            <SignUpLogIn />
          </Route> */}
          <Route path="/">
            </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
